Что тебе нужно знать обо мне? 
Я не могу оставить проблему просто так, я всё равно буду думать о ней, пока не найду решения; 
всё, что я знаю, я проверяю на практике, так эти знания становятся более глубокими;
я верю в людей, что они способны сделать этот мир лучше и помочь друг другу.
